(40, 'Full Time', 'Sales Engineer / Industrial  (Rotary Screw)  Compr', 'Mahesh IRServices', ' malani.mahesh@gmail.com', 'Sales / BD', '2', '', '', '3', '44', '496', 'Knowledge of Compressors and Allied Industrial Products', 'Experienced', '3.0-5.0', '', 16, 1618, 'Responsible for Industrial Automation Sales - Panels, Instrumentation products, Screw Compressors Any Instrumentation product Sales Exp like Industrial Sensors, transmitters, transducers, vision systems, Controllers, Indicators, High level knowledge in industrial sales. Have handled industries like power, cement, steel, mining, process industries, oil & gas, etc.  Order Booking and payment collection Good relationship with customers Responsible for complete P&L for this business (Presales, Order', '11-01-18/04:54:10pm', 'active'),
(46, 'Full Time', '.net web services developer', 'TechBuzz Technologies', ' techbuzz1990@gmail.com', 'Web / Graphic Design / Visualiser', '3', '', '', '3', '44', '489', 'good knowledge in .net web services ', 'Experienced', '2.0-3.0', '', 16, 1618, 'Interview will be scheduled in Aurangabad on 20th January Saturday. Preferred Job location might be PUNE. ', '17-01-18/06:34:18pm', 'active'),
(49, 'Full Time', 'Sr. python developer', 'TechBuzz Technologies', ' techbuzz1990@gmail.com', 'IT Software - Client Server', '1', '', '', '3', '44', '489', 'Python 2.7 Angular JS MYSOL/MSSQL with django python web frame work', 'Experienced', '5.0-11.0', '', 16, 1618, 'Python developer will be responsible for end-to-end web applications development and integration with various enterprise level applications using Django Python Web framework and related technologies. You would be responsible for building, enhancing and maintaining the several business-critical applications developed using Python, Angular JS, MSSQL.  You would be a technical expert with ability to understand the business requirements, prepare an action plan present the solution and write best quality source code with limited supervision from the technical manager.', '20-01-18/12:57:14pm', 'active'),
(50, 'Full Time', 'Marketing Intern', 'TechBuzz Technologies', ' techbuzz1990@gmail.com', 'Marketing / Advertising / MR / PR', '10', '', '', '2', '21', '331', 'Good communicators. Strong communication and interpersonal skills are essential for marketers. ... C', 'Fresher', '0.0-0.0', '', 16, 1618, 'Developing and implementing marketing and advertising campaigns;  maintaining promotional materials inventory; planning meetings; maintaining databases; preparing reports.maximise profits through developing sales strategies that match customer requirements and by promoting products, services or ideas.', '24-01-18/06:50:21pm', 'active'),
(56, 'Full Time', 'Java Devevloper', 'Ssiiddhey Instrumentation(OPC) Pvt.Ltd', ' umesh@ssipl.online', 'IT Software Other', '5', '', '', '2', '22', '336', 'java,servlet,spring mvc,spring security,hibernate,mysql,svn,maven,log4j', 'Experienced', '2.0-3.0', '', 16, 1618, 'candidate have worked on j2ee project', '25-01-18/05:30:47pm', 'inactive'),
(57, 'Full Time', 'Front Office Executive', 'Kabir Profile Solutions', ' kabirpune@vsnl.net', 'Beauty / Fitness / Spa Services', '1', '', '', '3', '50', '532', 'Strong English Communication, Customer oriented', 'Experienced', '1.0-11.0', '', 16, 1618, 'We urgently need a dynamic sales-oriented  female â€œFront Office Executiveâ€ for our client who is a pioneer in providing specialised, intensive training & guidance to help individuals so that they may become free of insulin & medicines naturally. Their programmes are well received PAN India.\r\nThis position is based in Deccan Area, Pune.\r\n\r\nManage all aspects of reception, front office, office administration, visitors, appointments, telephones, vendors, etc.\r\nConvincing customers about the effectiveness of their services. \r\n\r\n- Exp in Spa/ Hospitality/ Leisure/ Wellness/ Healthcare sector preferred\r\n- Qual - Any Graduate\r\n- Salary â€“ 15K â€“ 17K\r\n- Languages â€“ Fluency in English, Hindi & Marathi\r\n- Smart, Pleasing personality, Customer oriented, Enthusiastic and Highly energetic\r\n\r\nEmail CV in WORD format on - kabirpune@vsnl.net, kabirprofile@gmail.com\r\n\r\nAge around 30 â€“ 35 years.\r\nKindly share this opportunity with your friends having relevant experience.\r\n\r\nContact â€“\r\nRekha Bhati\r\nKabir Profile Solutions \r\nAundh, \r\nPune. \r\n\r\nConnect â€“ \r\nhttp://www.linkedin.com/in/amanrajabali\r\nhttps://www.facebook.com/amanrajabali', '27-01-18/03:03:49pm', 'active'),
