(162, 'Full Time', 'Android Architect', 'TechBuzz Technologies', 'techbuzz1990@gmail.com', 'IT Software - Mobile', '1', '', '', '3', '', '', 'Design, Develop Native Mobile, Web and Cordova based mobile applications using iOS', 'Experienced', '8.0-.', 'INDIA', 16, 1618, 'Able to provide end-to-end solution not just restricted to Native platform.\r\nWork as an Individual contributor, take ownership for the Product / Module and ensure the complete delivery until production environment.\r\nAdopt and implement best practices in native mobile app development, keep an open eye for the changes in the technology and adopt them swiftly\r\nDevelop software according to Project Standards. Works on continuous improvement of such standards. Fine Tune Standards, Guidelines and Architecture\r\n\r\nParticipate in the validation / acceptance phase of the product cycle ensuring the fine-tuning necessary to finalize the product.\r\nSupport the end user in the Production phase by debugging existing software solutions in response to Problem Tracking Records (PTR) and Change Requests (CR) issued from Product Management or Product Definition\r\nProvide the necessary knowledge Sharing and supporting junior staff members & Do the Code review\r\nIdentify the new areas of technical improvements on mobile and provide necessary support to get those ideas / improvements in the product.\r\nCompetencies Technical / Functional and Managerial\r\n\r\nSound knowledge and Working experience on Android development and sound knowledge on Java and Kotlin.\r\nExperience of working with 3rd party platforms such as Firebase, Adobe etc.\r\nSound knowledge of Automated unit testing in Android is mandatory\r\nVery strong experience on UI & iOS Standards & Guidelines & Process\r\nDeveloped / Participated in Developing Framework / Reusable components, Designed the Architecture of the Mobile Solutions\r\nStrong analytical & problem solving skills\r\n\r\nGood communication & Leadership skills\r\n\r\nAbility to work individually / in team and get the product successfully deliver', '12-03-18/12:14:13pm', 'active'),
